import React from "react";
import {useNavigate} from "react-router-dom";

const getMovie = (movieId) => {
    const navigate = useNavigate();
    navigate("/movie/" + movieId);

    return (
        <h5>{movieId}</h5>
    );
}

export default getMovie;
